// ==UserScript==
// @name         Яндекс.Почта - Заглушка рекламы справа
// @namespace    http://tampermonkey.net/
// @version      1.2
// @description  Накрывает рекламную панель справа фиксированной картинкой-заглушкой
// @author       You
// @match        https://mail.yandex.ru/*
// @icon         https://yastatic.net/morda-logo/i/logo-ru.png
// @grant        GM_addStyle
// @grant        GM_getResourceURL
// @grant        GM_addElement
// @resource     overlayImage https://i.imgur.com/ZK4pYfM.png
// @run-at       document-end
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/564364/%D0%AF%D0%BD%D0%B4%D0%B5%D0%BA%D1%81%D0%9F%D0%BE%D1%87%D1%82%D0%B0%20-%20%D0%97%D0%B0%D0%B3%D0%BB%D1%83%D1%88%D0%BA%D0%B0%20%D1%80%D0%B5%D0%BA%D0%BB%D0%B0%D0%BC%D1%8B%20%D1%81%D0%BF%D1%80%D0%B0%D0%B2%D0%B0.user.js
// @updateURL https://update.greasyfork.org/scripts/564364/%D0%AF%D0%BD%D0%B4%D0%B5%D0%BA%D1%81%D0%9F%D0%BE%D1%87%D1%82%D0%B0%20-%20%D0%97%D0%B0%D0%B3%D0%BB%D1%83%D1%88%D0%BA%D0%B0%20%D1%80%D0%B5%D0%BA%D0%BB%D0%B0%D0%BC%D1%8B%20%D1%81%D0%BF%D1%80%D0%B0%D0%B2%D0%B0.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // Ждем полной загрузки страницы
    if (window.top !== window.self) return; // Не выполняем во фреймах

    // Создаем overlay-элемент (картинку-заглушку)
    function createOverlay() {
        // Создаем контейнер
        const overlay = document.createElement('div');
        overlay.id = 'yandex-ad-overlay';

        // Создаем элемент изображения
        const img = document.createElement('img');
        img.src = 'data:image/jpeg;base64,';
        img.alt = '';
        img.style.width = '100%';
        img.style.height = '100%';
        img.style.objectFit = 'cover';
        img.style.opacity = '0.95';

        overlay.appendChild(img);

        // Добавляем стили
        const styles = `
            #yandex-ad-overlay {
                position: fixed !important;
                top: 0 !important;
                right: 0 !important;
                width: 335px !important; /* Ширина рекламной панели */
                height: 100vh !important;
                z-index: 999999 !important;
                pointer-events: auto !important; /* Клики проходят сквозь */
                background: #ffffff;
                border-left: 1px solid rgba(0,0,0,0.05);
                box-sizing: border-box;
                overflow: hidden;
            }

            /* Альтернативный вариант с цветом вместо картинки */
            #yandex-ad-overlay.color-version {
                background: linear-gradient(to right, rgba(255,255,255,0.1), #ffffff 20%) !important;
            }

            /* Для мобильной версии */
            @media (max-width: 1024px) {
                #yandex-ad-overlay {
                    width: 280px !important;
                }
            }

            @media (max-width: 768px) {
                #yandex-ad-overlay {
                    display: none !important;
                }
            }

            /* Гарантированно перекрываем все элементы */
            body > div:last-child {
                z-index: auto !important;
            }
        `;

        const styleSheet = document.createElement("style");
        styleSheet.textContent = styles;
        document.head.appendChild(styleSheet);

        // Добавляем overlay на страницу
        document.body.appendChild(overlay);
        console.log('Yandex Ad Overlay: Заглушка установлена');

        // Добавляем кнопку управления (опционально)
        addControlButton();
    }

    // Добавляем кнопку управления для тестирования
    function addControlButton() {
        const btn = document.createElement('button');
        btn.id = 'overlay-toggle';
        btn.innerHTML = '❌';
        btn.title = 'Скрыть/показать заглушку';
        btn.style.cssText = `
            position: fixed !important;
            bottom: 20px !important;
            right: 340px !important;
            z-index: 1000000 !important;
            width: 30px !important;
            height: 30px !important;
            border-radius: 50% !important;
            background: #f33 !important;
            color: white !important;
            border: none !important;
            cursor: pointer !important;
            font-size: 14px !important;
            opacity: 0.7 !important;
            transition: opacity 0.3s !important;
        `;

        btn.addEventListener('mouseenter', () => btn.style.opacity = '1');
        btn.addEventListener('mouseleave', () => btn.style.opacity = '0.7');
        btn.addEventListener('click', () => {
            const overlay = document.getElementById('yandex-ad-overlay');
            overlay.style.display = overlay.style.display === 'none' ? 'block' : 'none';
        });

        document.body.appendChild(btn);
    }

    // Запускаем после полной загрузки DOM
    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', createOverlay);
    } else {
        createOverlay();
    }

    // Также запускаем с задержкой для динамического контента
    setTimeout(createOverlay, 3000);

    // Наблюдаем за изменениями в DOM (на случай AJAX-загрузки)
    const observer = new MutationObserver((mutations) => {
        if (!document.getElementById('yandex-ad-overlay')) {
            createOverlay();
        }
    });

    observer.observe(document.body, { childList: true, subtree: true });

})();